import React from 'react';
import './ProjectTwo.css';

function ProjectTwo() {
    return (
        <>
            <section className="work-header">
                <h1 className="work-header-text">
                    <a href="https://www.jmwisewriting.com" target="_blank">jmwisewriting.com</a>
                </h1>
            </section>
        </>
    )
}

export default ProjectTwo
